Drash.Exceptions.HttpException:
/**
 * A property to hold the HTTP response code associated with this
 * exception.
 */
public code: number;

Drash.Exceptions.NameCollisionException:
/**
 * A property to hold the error message associated with this
 * exception.
 */
public message: string;

Drash.Http.Request:
/**
 * A property to hold the request's headers.
 */
public headers: Headers;

/**
 * A property to hold the request's methods (e.g., GET, POST, PUT, etc.).
 */
public method: string;

/**
 * A property to hold the request's URL.
 */
public url: string;

/**
 * A property to hold the request's path params and their values.
 */
public path_params: { [key: string]: string }

/**
 * A property to hold the request's URL query params and their values.
 */
public url_query_params: { [key: string]: string };

/**
 * A property to hold the request's URL path.
 */
public url_path: string;

/**
 * A property to hold the resource this request targets.
 */
public resource: Drash.Http.Resource | null = null;

/**
 * A property to hold the original ServerRequest object from Deno.
 */
protected original_request: ServerRequest;

/**
 * Gets all header params.
 *
 * @return Key value pairs for the header name and it's value
 */
public getAllHeaderParams(): { [key: string]: string }

/**
 * Get the value of one of this request's body params by its input name.
 *
 * @param input - The name of the body param to get.
 *
 * @returns The corresponding parameter or null if not found.
 */
public getBodyParam(
    input: string,
  ): string | { [key: string]: unknown } | Array<unknown> | boolean | null

/**
 * Get the request's URL query params by parsing its URL query string.
 *
 * @return The URL query string in key-value pair format.
 */
private getUrlQueryParams(): { [key: string]: string }

/**
 * Respond the the client's request by using the original request's respond()
 * method.
 *
 * @param output - The data to respond with.
 */
public async respond(
    output: Drash.Interfaces.ResponseOutput,
  ): Promise<void>

Drash.Http.Resource:
/**
 * A property to hold the middleware this resource uses.
 */
public middleware: { after_request?: []; before_request?: [] }

/**
 * A property to hold the name of this resource. This property is used by
 * Drash.Http.Server to help it store resources in its resources property
 * by name.
 */
public name: string = "";

/**
 * A property to hold the expanded versions of the paths. See
 * Drash.Interfaces.ResourcePaths for more information.
 */
public paths_parsed: Drash.Interfaces.ResourcePaths[] = [];

/**
 * The request object that targeted this resource.
 */
protected request: Drash.Http.Request;

/**
 * The response object that this resource will use to respond to the request.
 */
protected response: Drash.Http.Response;

/**
 * The server object.
 */
protected server: Drash.Http.Server;

Drash.Http.Response:
/**
 * A property to hold the body of this response.
 */
public body: boolean | null | object | string | undefined = "";

/**
 * A property to hold this response's headers.
 */
public headers: Headers;

/**
 * The request object this response will respond to.
 */
public request: Drash.Http.Request;

/**
 * A property to hold this response's status code (e.g., 200 for OK).
 * This class uses Status and STATUS_TEXT from the Deno Standard
 * Modules' http_status module for response codes.
 */
public status_code: number = Status.OK;

/**
 * See IOptions under Drash.Http.Response.
 */
protected options: IOptions;

/**
 * This method allows users to make `this.response.render()` calls in
 * resources. This method is also used by Tengine:
 *
 *   https://github.com/drashland/deno-drash-middleware/tree/master/tengine
 */
public render(
    ...args: unknown[]
  ): Promise<boolean | string> | boolean | string

Drash.Http.Server:
/**
 * A property to hold the Deno server. This property is set in
 * this.run() like so:
 *
 *     this.deno_server = serve(HTTPOptions);
 *
 * serve() is imported from https://deno.land/x/http/server.ts.
 */
public deno_server: DenoServer | null = null;

/**
 * The hostname of the Deno server.
 */
public hostname: string = "localhost";

/**
 * The port of the Deno server.
 */
public port: number = 1447;

/**
 * A property to hold this server's configs.
 */
protected configs: Drash.Interfaces.ServerConfigs;
